    "2016-07-27T22:45:03.625910",nt"name": "chautauqua-national-wildlife-refuge-narrative-report-september-october-november-and-decem-",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Chautauqua NWR
    outlines Refuge accomplishments from September through December of 1943. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, furbearers, rodents, mammals,
    raptors, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments. Resource management is outlined; topics include
    fur harvesting. A progress report on field investigations and applied research is
    also provided. The public relations section of the report describes recreational
    uses, Refuge visitors, hunting, fishing, and violations. N-R forms are attached.",nt"license_title":
